function generateSliderTrack(targetDistance) {
    let track = [];
    let startTime = Math.floor(Date.now());
    let currentDistance = 0;
    let currentTime = 0;
    let yOffset = 0;

    track.push(startTime.toString());
    while (currentDistance < targetDistance) {
        // 时间步长随机，模拟不均匀采样，20~60ms之间
        let timeStep = Math.floor(Math.random() * 41) + 20;
        currentTime += timeStep;

        // 横向步长，接近目标时减小步长
        let xStep;
        if (targetDistance - currentDistance > 10) {
            xStep = Math.floor(Math.random() * 7) + 4;
        } else {
            xStep = Math.floor(Math.random() * 4) + 1;
        }

        currentDistance += xStep;
        if (currentDistance > targetDistance) {
            currentDistance = targetDistance;
        }

        // 纵向浮动在-8到8之间，模拟抖动
        yOffset = Math.floor(Math.random() * 17) - 8;

        track.push(currentTime.toString(), currentDistance.toString(), yOffset.toString());
    }

    let endDate = startTime + currentTime + Math.floor(Math.random() * 401) + 100;
    track.push(endDate.toString());
    let trackStr = track.join(",");
    return trackStr;
}
